import { useGlitch } from "react-powerglitch";

const Glitch = (props) => {
  const glitch = useGlitch({
    playMode: "hover",
    hideOverflow: "true",
    shake: false,
  });
  return <div ref={glitch.ref}>{props.children}</div>;
};

export default Glitch;
